		set random_num = floor(rand()*5 + 1);

		while (iter1 < random_num) do

			set Current_City1 = substring('ABCDEFabcRSTUVdefghijklMNOPQWXYZmnopqrsGHIJKLtuvwxyz',floor(rand()*25)+1,floor(rand()*6)+1); 

			select Registration_ID
